post.description:
Receive a subscription or container event.
Push messages are always sent in JSON format, XML is not supported. Your implementation should respond with one of the specified status codes to indicate success. In case of other status codes, our service will interpret this as a failure and will retry several times using a backoff-strategy. Sometimes our support team will send test events - especially during setup and configuration. To support these properly, your server implementation should respond with one of the success status codes and simply log or discard these event messages.

